import React, { useState } from "react";
import "./Home.css";
import SimpleImageSlider from "react-simple-image-slider";
import HR3 from "./images/HR-3.jpg";
import HR1 from "./images/HR-1.jpg";
import leadership from "./images/leadership.jpg";
import about from "./images/about-us.jpg"; 
import border from "./images/m-1.png";
import Container from "@mui/material/Container"; 

function Home() {

    const sliderImages = [
        {
            url: HR3,
        },
        {
            url: HR1,
        },
        {
            url: leadership,
        },
    ];

    return (
        <div className="content-container">
            <h1>welcome</h1>
            <div className="slider">
                <SimpleImageSlider
                    width={"100%"}
                    height={"100%"}
                    autoPlay={true}
                    autoPlayDelay = {3}
                    images={sliderImages}
                    showNavs={true}
                />
            </div>
            <div>
         <h4>
            {" "}
            Using the <i> Container </i> Component of the Material UI to create a container in the React application {" "} </h4>
            <div style = {{display: "flex", justifyContent: "space-around"}}>
               <Container fixed>
                  <div style = {{ backgroundColor: "pink", height: "30rem", width: "90%" }}>
                     {" "}
                     This is a content of the container div. {" "}
                  </div>
               </Container>
               <Container fixed>
                  <div style = {{ backgroundColor: "pink", height: "30rem", width: "90%" }}>
                     {" "}
                     This is a content of the container div. {" "}
                  </div>
               </Container>
            </div>
      </div>
        </div>
    );
}


export default Home;
